pragma solidity >=0.4.23 <0.6.0;

import 'openzeppelin-solidity/contracts/ownership/Ownable.sol';

contract Procurement is Ownable {
  address[] allTenders;
  mapping(address => address[]) tenders;

  function registerTender(address _contractAddress) public {
    allTenders.push(_contractAddress);
    tenders[msg.sender].push(_contractAddress);
  }

  function getTendersSize() public view returns (uint) {
    uint size = tenders[msg.sender].length;
    if (size != 0) {
      return size;
    }
    return allTenders.length;
  }

  function getTender(uint _tenderIdx) public view returns (address) {
    uint size = tenders[msg.sender].length;
    if (size != 0) {
      return tenders[msg.sender][_tenderIdx];
    }
    return allTenders[_tenderIdx];
  }
}
